import React from 'react';
import { connect, useDispatch } from "react-redux";

import {logoutUser} from "../actions/userActions";

import '../stylesheets/Header.css';
import HamburgerMenu from "./HamburgerMenu";

/**
 * @author Magnus & Sven
 * @version 06/08/2021
 * Header for navigation.
 * @param props
 * @component
 */
const Header = (props) => {

    const dispatch = useDispatch();

    /**
     * Handles clicks on logout.
     * Dispatches logoutUser
     * @returns void
     * @memberOf Header
     */

    const handleClick = () => {
        dispatch(logoutUser());
    }

    return (
    <div className="navBar">
        <div className="navBarContent">
            {props.auth.isAuthenticated ? <HamburgerMenu width={"2em"} height={"2em"}/> : null}
            <div className="laddelContainer">
                <img onClick={() => window.location="/"} id="laddel" src="https://www.laddel.no/wp-content/uploads/2021/06/ladddel-gronn-logo-kopi-1024x248.png"/></div>
        </div>
    </div>
    )
}

const mapStateToProps = (state) => {
    return {
        auth: state.auth
    }
}

export default connect(mapStateToProps)(Header);
